import Link from 'next/link'
import Layout from '../components/MyLayout';
import { FaGithub, FaLinkedin } from "react-icons/fa";
import { MdEmail } from "react-icons/md";
//import Beard from '../static/images/beard.png';
//import London from '../static/images/tech.png';
//import Weather from '../static/images/weather.png';



export default () => (
  <Layout>
    <div>
        <h2>Contact Details</h2>
        
    </div>

    <div className="col-md-6 d-flex justify-content-around">
        <a  href="https://www.linkedin.com/in/bongani-maila/" >
            <FaLinkedin className="linkedIn" width="200" height="200"/>
            <br />
        </a>
    </div>
    
    <div className="col-md-6 d-flex justify-content-around">
        <a  href="https://github.com/BonganiMaila">
            <FaGithub className="Github" />   
            <br />
        </a>
    </div>

    <div className="email">
    <MdEmail className="icon" />

    </div>
    <div className="cell">

    </div>

    
  </Layout>
)
